import { useDispatch, useSelector } from "react-redux"
import { updateUrl } from "./redux/reducers/activeUrlReducer";
import { deleteSong } from "./redux/reducers/songReducer";

const SongList = () => {
    const dispatch = useDispatch();
    const songs = useSelector((state) => state.songStore.value)
    const jsxSongs = songs.map(i => <li key={i.id}>{i.songName}{i.id}<button onClick={()=>dispatch(updateUrl(i.url))}>Přehrát</button><button onClick={()=>dispatch(deleteSong(i.id))}>Odstranit</button></li>)
    return(
        <ol>
            {jsxSongs}
        </ol>
    )
}
export default SongList
